        (<TextField fullWidth label="Data Range" size="small" select
            InputLabelProps={{style: { fontSize: 8 }}}
            InputProps={{style: { fontSize: 8}}}
            onChange={(e)=>{handleValueChange(e,"colorScheme")}}
            value={values.colorScheme}>
                {
                    values.dataType === "continuous" && linearSchemes.map((scheme) => (
